package com.samin.leetcode.algorithms;

public class IsSubsequence {

    public static void main(String[] args) {
        // t f t f t
        //        System.out.println(new IsSubsequence().isSubsequence("ace", "abcde"));
        //        System.out.println(new IsSubsequence().isSubsequence("aec", "abcde"));
        //        System.out.println(new IsSubsequence().isSubsequence("abc", "ahbgdc"));
        //        System.out.println(new IsSubsequence().isSubsequence("axc", "ahbgdc"));
        //        System.out.println(new IsSubsequence().isSubsequence("", "ahbgdc"));
        System.out.println(
                new IsSubsequence()
                        .isSubsequence(
                                "leeeeetcode",
                                ""));
    }

    public boolean isSubsequence(String s, String t) {
        char[] sChar = s.toCharArray();
        char[] tChar = t.toCharArray();

        if (sChar.length == 0) {
            return true;
        }

        if (tChar.length == 0) {
            return false;
        }

        int index = 0;
        for (int i = 0; i < tChar.length; i++) {
            if (tChar[i] == sChar[index]) {
                index = index + 1;
                if (index == s.length()) {
                    return true;
                }
            }
        }

        return index == t.length();
    }
}
